export default function Todos() {
    const todos = localStorage.getItem('todos')
    if(todos){
        todos.map(todo=>{
            if(todo.name === null || todo.task === null) return false
            return(
            <>
                <li className="todos">
                    <div className="listElement">
                        <div className="listElement__elements">
                            <h1 className="listElement__elements__name">{todo.name}</h1>
                            <p className="listElement__elements__task">{todo.task}</p>
                        </div>
                    </div>
                </li>
            </>)
        })
    }
}
